import axios from 'axios';

export default class PostService {
    static async getAll(limit = 10 , page = 1) {
        const responce = await axios.get(`https://jsonplaceholder.typicode.com/posts`, {
            _limit: limit,
            _page: page
        })
        return responce 

    }
}
